import React, { useState } from 'react';
import  {TextField,Button}  from '@material-ui/core';
import AddIcon from '@mui/icons-material/Add';
import DeleteIcon from '@mui/icons-material/Delete';
import ListComp from './ListComp';
const Todolist = () => {
    const [Items,newItems]=useState();
    const [items,setitems]=useState([]);
    const fun1=(e)=>{
        const val=e.target.value;
        newItems(val);
    }
    const fun2=()=>{
        setitems((prev)=>{
           return [...prev,Items]}
        );
        newItems("");
    }
    return (
        <>
            <div className="container">
            <div className='Main_div'>
                <h1>TODO LIST</h1>
                <div className='Items'>
                    <TextField id="standard-basic" label="Add a Item" onChange={fun1} value={Items}/>
                    <Button  variant="contained" color="primary" onClick={fun2}>
                        <AddIcon/>
                    </Button>
                </div>
                <div className='list'>
                <ol>{
                    items.map( (val)=> {
                        return (<>
                        <div className='ITEMS'>
                        <ListComp text={val}/>
                    
                        </div>
                        </>
                        )
                    })
                }
                </ol>
                </div>
            </div>
            </div>
        </>);
}
export default Todolist;
